import React, { useState } from "react";
import { DragDropContext, Droppable, Draggable } from "@hello-pangea/dnd";

const initialFields = [
  { id: "field-1", label: "First Name", type: "text", placeholder: "Enter your first name", required: false },
  { id: "field-2", label: "Email", type: "email", placeholder: "Enter your email", required: true },
  { id: "field-3", label: "Date of Birth", type: "date", placeholder: "", required: true },
];

const FormBuilder = () => {
  const [fields, setFields] = useState(initialFields);
  const [containerFields, setContainerFields] = useState([]);
  const [selectedFieldId, setSelectedFieldId] = useState(null);

  const onDragEnd = (result) => {
    const { source, destination } = result;
    if (!destination) return;

    // Moving fields between lists
    if (source.droppableId === "fields" && destination.droppableId === "container") {
      const draggedField = fields[source.index];
      if (!containerFields.some((field) => field.id === draggedField.id)) {
        setContainerFields([...containerFields, draggedField]);
      }
    } else if (source.droppableId === "container" && destination.droppableId === "container") {
      const reorderedFields = Array.from(containerFields);
      const [moved] = reorderedFields.splice(source.index, 1);
      reorderedFields.splice(destination.index, 0, moved);
      setContainerFields(reorderedFields);
    }
  };

  const handleFieldUpdate = (id, key, value) => {
    const update = (fieldList) =>
      fieldList.map((field) =>
        field.id === id ? { ...field, [key]: key === "required" ? !field.required : value } : field
      );

    setFields(update(fields));
    setContainerFields(update(containerFields));
  };

  const FieldEditor = ({ field }) => (
    <div style={{ border: "1px solid #ddd", padding: "10px", marginTop: "10px" }}>
      <h4>Edit Field</h4>
      <label>
        Label:
        <input
          type="text"
          value={field.label}
          onChange={(e) => handleFieldUpdate(field.id, "label", e.target.value)}
        />
      </label>
      <br />
      <label>
        Placeholder:
        <input
          type="text"
          value={field.placeholder}
          onChange={(e) => handleFieldUpdate(field.id, "placeholder", e.target.value)}
        />
      </label>
      <br />
      <label>
        Required:
        <input
          type="checkbox"
          checked={field.required}
          onChange={() => handleFieldUpdate(field.id, "required")}
        />
      </label>
    </div>
  );

  return (
    <div style={{ padding: "20px" }}>
      <h1>Form Builder</h1>
      <DragDropContext onDragEnd={onDragEnd}>
        <div style={{ display: "flex", gap: "20px" }}>
          {/* Fields List */}
          <Droppable droppableId="fields">
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                style={{ width: "300px", border: "1px solid #ddd", padding: "10px" }}
              >
                <h3>Available Fields</h3>
                {fields.map((field, index) => (
                  <Draggable key={field.id} draggableId={field.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          ...provided.draggableProps.style,
                          margin: "5px 0",
                          padding: "10px",
                          backgroundColor: "#f0f0f0",
                          border: "1px solid #ccc",
                          borderRadius: "5px",
                        }}
                        onClick={() => setSelectedFieldId(field.id)}
                      >
                        {field.label}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>

          {/* Container Field */}
          <Droppable droppableId="container">
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                style={{
                  flex: 1,
                  border: "2px dashed #bbb",
                  padding: "10px",
                  minHeight: "300px",
                  backgroundColor: "#fafafa",
                }}
              >
                <h3>Form Preview</h3>
                {containerFields.map((field, index) => (
                  <Draggable key={field.id} draggableId={field.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          ...provided.draggableProps.style,
                          margin: "5px 0",
                          padding: "10px",
                          backgroundColor: "#e0f7fa",
                          border: "1px solid #00acc1",
                          borderRadius: "5px",
                        }}
                        onClick={() => setSelectedFieldId(field.id)}
                      >
                        {field.label}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </div>
      </DragDropContext>

      {/* Field Editor */}
      {selectedFieldId && (
        <FieldEditor field={fields.find((field) => field.id === selectedFieldId)} />
      )}
    </div>
  );
};

export default FormBuilder;
